class App extends React.Component {
  componentDidMount() {
    fetch('http://localhost:3000/deck')
    .then()
  }

  render() {
    return (
      <div className="App">
        sup
        <p>testing testing yoyoyo</p>
        {this.props.deck.map(card => card.name)}
        {/* <gameContainer /> */}
      </div>
    )
  }

}

const mapStateToProps = (state) => {
  return {
    deck: state.deck
  }
}

export default connect(mapStateToProps)(App);
